var slider = null;
var sliderTimer = null;
var timerIsOn = false;
var positionTarget = 99;

var othersobj = null;
var tauobj = null;
var bobj = null;
var wobj = null;
var zobj = null;
var topobj = null;

var otherstext = null;
var tautext = null;
var btext = null;
var wtext = null;
var ztext = null;
var toptext = null;

function init(evt) {
    slider = document.getElementById("slider");

    othersobj = document.getElementById("othersarrow");
    tauobj = document.getElementById("tauarrow");
    bobj = document.getElementById("barrow");
    wobj = document.getElementById("warrow");
    zobj = document.getElementById("zarrow");
    topobj = document.getElementById("toparrow");

    otherstext = document.getElementById("otherstext");
    tautext = document.getElementById("tautext");
    btext = document.getElementById("btext");
    wtext = document.getElementById("wtext");
    ztext = document.getElementById("ztext");
    toptext = document.getElementById("toptext");

    slider.setAttribute("x", 183);
    setFractions(0., 0.3, 0.0, 0.2, 0.1);
    thePhysics();
}

function setFractions(topfrac, zfrac, wfrac, bfrac, taufrac) {
    var zero = 952.61978;
    var one = 1052.3178;

    topnumber = Math.round(topfrac * 100.);
    znumber = Math.round(zfrac * 100.);
    wnumber = Math.round(wfrac * 100.);
    bnumber = Math.round(bfrac * 100.);
    taunumber = Math.round(taufrac * 100.);
    othersnumber = 100 - topnumber - znumber - wnumber - bnumber - taunumber;

    othersfrac = 1. - topfrac - zfrac - wfrac - bfrac - taufrac;

    y1 = zero;
    y2 = zero + (topfrac)*(one - zero);
    topdata[15] = topdata[19] = topdata[23] = topdata[27] = topdata[31] = y1 - 15;
    topdata[35] = topdata[39] = topdata[43] = topdata[47] = topdata[51] = y2 - 15;
    toptext.setAttribute("y", (y1 + y2 - 30)/2. + 4.);
    toptext.textContent = topnumber + "%";
    if (topfrac < 0.12) { toptext.setAttribute("visibility", "hidden"); }
    else { toptext.setAttribute("visibility", "visible"); }

    y1 = y2;
    y2 = zero + (topfrac + zfrac)*(one - zero);
    zdata[15] = zdata[19] = zdata[23] = zdata[27] = zdata[31] = y1 - 9;
    zdata[35] = zdata[39] = zdata[43] = zdata[47] = zdata[51] = y2 - 9;
    ztext.setAttribute("y", (y1 + y2 - 18)/2. + 4.);
    ztext.textContent = znumber + "%";
    if (zfrac < 0.12) { ztext.setAttribute("visibility", "hidden"); }
    else { ztext.setAttribute("visibility", "visible"); }

    y1 = y2;
    y2 = zero + (topfrac + zfrac + wfrac)*(one - zero);
    wdata[15] = wdata[19] = wdata[23] = wdata[27] = wdata[31] = y1 - 3;
    wdata[35] = wdata[39] = wdata[43] = wdata[47] = wdata[51] = y2 - 3;
    wtext.setAttribute("y", (y1 + y2 - 6)/2. + 4.);
    wtext.textContent = wnumber + "%";
    if (wfrac < 0.12) { wtext.setAttribute("visibility", "hidden"); }
    else { wtext.setAttribute("visibility", "visible"); }

    y1 = y2;
    y2 = zero + (topfrac + zfrac + wfrac + bfrac)*(one - zero);
    bdata[15] = bdata[19] = bdata[23] = bdata[27] = bdata[31] = y1 + 3;
    bdata[35] = bdata[39] = bdata[43] = bdata[47] = bdata[51] = y2 + 3;
    btext.setAttribute("y", (y1 + y2 + 6)/2. + 4.);
    btext.textContent = bnumber + "%";
    if (bfrac < 0.12) { btext.setAttribute("visibility", "hidden"); }
    else { btext.setAttribute("visibility", "visible"); }

    y1 = y2;
    y2 = zero + (topfrac + zfrac + wfrac + bfrac + taufrac)*(one - zero);
    taudata[15] = taudata[19] = taudata[23] = taudata[27] = taudata[31] = y1 + 9;
    taudata[35] = taudata[39] = taudata[43] = taudata[47] = taudata[51] = y2 + 9;
    tautext.setAttribute("y", (y1 + y2 + 18)/2. + 4.);
    tautext.textContent = taunumber + "%";
    if (taufrac < 0.12) { tautext.setAttribute("visibility", "hidden"); }
    else { tautext.setAttribute("visibility", "visible"); }

    y1 = y2;
    y2 = one;
    othersdata[15] = othersdata[19] = othersdata[23] = othersdata[27] = othersdata[31] = y1 + 15;
    othersdata[35] = othersdata[39] = othersdata[43] = othersdata[47] = othersdata[51] = y2 + 15;
    otherstext.setAttribute("y", (y1 + y2 + 30)/2. + 4.);
    otherstext.textContent = othersnumber + "%";
    if (othersfrac < 0.12) { otherstext.setAttribute("visibility", "hidden"); }
    else { otherstext.setAttribute("visibility", "visible"); }

    topobj.setAttribute("d", topdata.join(""));
    zobj.setAttribute("d", zdata.join(""));
    wobj.setAttribute("d", wdata.join(""));
    bobj.setAttribute("d", bdata.join(""));
    tauobj.setAttribute("d", taudata.join(""));
    othersobj.setAttribute("d", othersdata.join(""));

    if (topfrac < 0.015) { topobj.setAttribute("visibility", "hidden"); } else { topobj.setAttribute("visibility", "visible"); }
    if (zfrac < 0.015) { zobj.setAttribute("visibility", "hidden"); } else { zobj.setAttribute("visibility", "visible"); }
    if (wfrac < 0.015) { wobj.setAttribute("visibility", "hidden"); } else { wobj.setAttribute("visibility", "visible"); }
    if (bfrac < 0.015) { bobj.setAttribute("visibility", "hidden"); } else { bobj.setAttribute("visibility", "visible"); }
    if (taufrac < 0.015) { tauobj.setAttribute("visibility", "hidden"); } else { tauobj.setAttribute("visibility", "visible"); }
    if (othersfrac < 0.015) { othersobj.setAttribute("visibility", "hidden"); } else { othersobj.setAttribute("visibility", "visible"); }
}

function thePhysics() {
    minPosition = 99;
    maxPosition = 928;
    position = parseFloat(slider.getAttribute("x"));

    m = 100. + (500. - 100.) * (position - minPosition) / (maxPosition - minPosition);
    index = higgsMass.length - 1;
    interpolation = 0.;
    for (var i = 1;  i < higgsMass.length;  i++) {
        if (higgsMass[i] > m) {
            index = i;
            interpolation = (m - higgsMass[i-1]) / (higgsMass[i] - higgsMass[i-1]);
            break;
        }
    }
    prevIndex = index - 1;

    bb = branchBB[prevIndex] + interpolation * (branchBB[index] - branchBB[prevIndex]);
    ww = branchWW[prevIndex] + interpolation * (branchWW[index] - branchWW[prevIndex]);
    zz = branchZZ[prevIndex] + interpolation * (branchZZ[index] - branchZZ[prevIndex]);
    tt = branchTT[prevIndex] + interpolation * (branchTT[index] - branchTT[prevIndex]);
    tautau = branchTauTau[prevIndex] + interpolation * (branchTauTau[index] - branchTauTau[prevIndex]);

    setFractions(tt/100.4, zz/100.4, ww/100.4, bb/100.4, tautau/100.4);
}

function approachPosition() {
    here = parseFloat(slider.getAttribute("x"));
    timerIsOn = false;

    if (here > positionTarget + 10) {
        slider.setAttribute("x", here - 10);
        thePhysics();
        timerIsOn = true;
        sliderTimer = setTimeout("approachPosition()", 10);
    }
    else if (here < positionTarget - 10) {
        slider.setAttribute("x", here + 10);
        thePhysics();
        timerIsOn = true;
        sliderTimer = setTimeout("approachPosition()", 10);
    }
    else {
        slider.setAttribute("x", positionTarget);
        thePhysics();
    }
}

function fixScale(position) {
    pt = document.getElementById("svg2").createSVGPoint();
    rect = document.getElementById("frame");
    matrix = rect.getScreenCTM();
    pt.x = 0;
    pt.y = 0;
    topleft = pt.matrixTransform(matrix);
    pt.x += 1024.;
    pt.y += 768.;
    bottomright = pt.matrixTransform(matrix);    
    return (position - topleft.x) * 1024./(bottomright.x - topleft.x);
}

function moveInSlider(evt) {
    minimum = 99;
    maximum = 928;
    positionTarget = Math.min(Math.max(fixScale(evt.clientX), minimum), maximum)

    if (!timerIsOn) {
        approachPosition();
    }
}

